public class IntrastatParameters extends FormRun
{
    NumberSeqReference      numberSeqReference;
    boolean                 runExecuteDirect;
    TmpIdRef                tmpIdRef;
    NumberSeqScope             scope;
    NumberSeqApplicationModule numberSeqApplicationModule;
    container                  numberSequenceModules;
    LogisticsPostalAddressFormHandler addressController;

    private const str IntrastatERModelName = 'Intrastat';
    private const str EUSLERModelName = 'EU sales list';
    private const str BlackListERModelName = 'Italian tax reports';
    private const str BlackListERModelDefinitionName = 'Blacklist';

}

public void init()
{
    #IsoCountryRegionCodes

    this.numberSeqPreInit();

    boolean isExtendedCountryRegionEnabled = IntrastatParametersHelper::isExtendedCountryRegionEnabled();

    super();

    FormDataObject fieldLegalCountryRegionId = IntrastatCountryRegionParameters_ds.object(fieldNum(IntrastatCountryRegionParameters, LegalCountryRegionId));

    IntrastatParameters::find();

    this.numberSeqPostInit();
    element.updateDesign();

    addressController = LogisticsPostalAddressFormHandler::newParameters(intrastatParameters_ds, logisticsPostalAddress_ds);
    addressController.callerUpdateQuery(fieldNum(IntrastatParameters,AgentLocation));

    fieldLegalCountryRegionId.visible(isExtendedCountryRegionEnabled);
    fieldLegalCountryRegionId.mandatory(isExtendedCountryRegionEnabled);

    boolean intrastatReportingByTaxIdFeature = TaxIntegrationUtils::isMultipleTaxIdEnabledForIntrastat();
    CountryElectronicReporting.visible(intrastatReportingByTaxIdFeature);
    ElectronicReporting.visible(!intrastatReportingByTaxIdFeature);

    if (intrastatReportingByTaxIdFeature)
    {
        CheckSetup_VATNum.label("@IntrastatByTaxId:CounterpartyTaxRegistrationNumber");
    }

    boolean euSalesListReportingByTaxIdFeature = TaxIntegrationUtils::isMultipleTaxIdEnabledForEUSalesList();
    EUSalesListCountryReportingTabPage.visible(euSalesListReportingByTaxIdFeature);
    EUSalesListElectronicReportingTabPage.visible(!euSalesListReportingByTaxIdFeature);
    IntrastatParameters_ds.object(fieldNum(IntrastatParameters, AuthorizedBy_CZ)).visible(!euSalesListReportingByTaxIdFeature);
    IntrastatParameters_ds.object(fieldNum(IntrastatParameters, AuthorizedByRole_CZ)).visible(!euSalesListReportingByTaxIdFeature);
    IntrastatParameters_ds.object(fieldNum(IntrastatParameters, FilledBy)).visible(!euSalesListReportingByTaxIdFeature);
    TabPageCompanyInfo.visible(!euSalesListReportingByTaxIdFeature);

    TabPageEUSalesList.visible(SysCountryRegionCode::isLegalEntityInCountryRegion([#isoAT, #isoBE, #isoBG, #isoCH, #isoCY, #isoCZ,
        #isoDE, #isoDK, #isoEE, #isoGR, #isoES, #isoFI, #isoFR, #isoGB, #isoHR, #isoHU, #isoIE, #isoIT, #isoLT, #isoLU, #isoLV,
        #isoMT, #isoNL, #isoPL, #isoPT, #isoRO, #isoSE, #isoSI, #isoSK])
        || euSalesListReportingByTaxIdFeature);

    boolean isMiscChargesVisible = MultipleTaxIdReportingHelper::isLegalEntityOrAddressInCountryRegion([#isoIT], MultipleTaxIdScope::Intrastat);
    IntrastatReportingParameter_ds.object(fieldNum(EUSalesListReportingParameter, MiscellaneousChargesPerKilogram)).visible(isMiscChargesVisible);
}

void numberSeqPreInit()
{
    runExecuteDirect   = false;
    numberSequenceModules = [NumberSeqModule::ForeignTrade];
    numberSeqApplicationModule = new NumberSeqModuleForeignTrade();
    scope = NumberSeqScopeFactory::createDataAreaScope();
    NumberSeqApplicationModule::createReferencesMulti(numberSequenceModules, scope);
    tmpIdRef.setTmpData(NumberSequenceReference::configurationKeyTableMulti(numberSequenceModules));
}

public void updateDesign()
{
    boolean intrastatStateFeatureEnabled = FeatureStateProvider::isFeatureEnabled(IntrastatCountryRegionStateFeature::instance());

    button_IntrastatStateParameters.enabled(intrastatStateFeatureEnabled
        || (intrastatCountryRegionParameters.CountryRegionId
            && intrastatCountryRegionParameters.CountryRegionType == CountryRegionType::Domestic));
}

private void enableMiscChargesPerKilogram()
{
    #ISOCountryRegionCodes
    str isoCode = LogisticsAddressCountryRegion::find(IntrastatReportingParameter.CountryRegionId).ISOCode;

    boolean allowEdit = (isoCode == #isoIT);
    IntrastatReportingParameter_ds.object(fieldNum(EUSalesListReportingParameter, MiscellaneousChargesPerKilogram)).allowEdit(allowEdit);
}

